import Sequelize from "sequelize";
import { sequelize } from "../database/database";

const Tutor = sequelize.define(
  "tutor",
  {
    tt_id: {
      type: Sequelize.INTEGER,
      primaryKey: true,
    },
    tt_name: {
      type: Sequelize.CHAR,
    },
    tt_lastname: {
      type: Sequelize.CHAR,
    },
    tt_email: {
      type: Sequelize.CHAR,
    },
    tt_age: {
      type: Sequelize.INTEGER,
    },
    tt_created_tm: {
      type: Sequelize.DATE,
